import {get, post} from '~/utils/fetch'
export default {
  fetch_base_information: (params) => {
    return get(`/core/rural/areaTree`, params)
  },
  fetch_base_list: (params) => {
    return get(`/core/rural/getCreditPerson`, params)
  },
  fetch_communityCredit_list: (params) => {
    return get(`/core/rural/getCreditVillage`, params)
  },
  fetch_streetCredit_list: (params) => {
    return get(`/core/rural/getCreditStreet`, params)
  },
  fetch_creditScore_list: (params) => {
    return get(`/core/rural/getCreditDetail`, params)
  },
  fetch_grade_list: (params) => {
    return get(`/core/rural/getLevel`, params)
  },
}
